import React from "react"
import Button from "./Button"

class ButtonContainer extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div id="button-container">
                <Button functionName="mask" actions={this.actions}/>
                <Button functionName="spider" actions={this.actions}/>
                <Button functionName="camera" actions={this.actions}/>
                <Button functionName="kiwi" actions={this.actions}/>
                <Button functionName="lemon" actions={this.actions}/>
                <Button functionName="death" actions={this.actions}/>
                <Button functionName="d20" actions={this.actions}/>
            </div>
        )
    }
}

export default ButtonContainer
